    ?event wdt:P582 ?end .
  }
  OPTIONAL {
    ?event wdt:P585 ?pointInTime .
  }
  FILTER ( ( BOUND( ?start ) && ?start >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime && ?start <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) || ( BOUND( ?end ) && ?end >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime && ?end <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) || ( BOUND( ?pointInTime ) && ?pointInTime >= "1910-01-01T00:00:00Z" ^^ xsd:dateTime && ?pointInTime <= "1920-12-31T23:59:59Z" ^^ xsd:dateTime ) ) OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( lang( ?eventLabel ) = "en" )
  }
}
ORDER BY DESC ( ?deaths )
LIMIT 1

